import classes from "./Todo.module.css";
import TodoInput from "./TodoInput";
import Heavity from "./Heavity";
import Scarity from "./Scarity";

const Todo = () => {
  return (
    <div className={classes.todo}>
      <TodoInput />
      <Heavity />
      <Scarity />
    </div>
  );
};

export default Todo;
